LiL Wicked and SkullFuck dropped their first album in October of 2009 titled Judged by Twelve or Carried by Six, their second album Verbal Weaponry in August 2011 and their untitled 2012 mix-tape in December. 

Wicked Wild Records has put out 7 music videos and a new one is on the way. You can view them by checking out our YouTube channel 
If you like what we put out please take time to subscribe.

